opie','Check this box to prevent your end consumer from copying and pasting content from your PDF.'=>'Cochez cette case pour empêcher votre consommateur final de copier et coller le contenu de votre fichier PDF.','Disable Editing'=>'Désactiver la modification','Check this box to prevent editing of your PDF by the end consumer in Acrobat.'=>'Cochez cette case pour empêcher la modification de votre fichier PDF par le consommateur final dans Acrobat.','Disable Annotations'=>'Désactiver les Annotations','Check this box to prevent the addition of annotations and forms to the file.'=>'Cochez cette case pour empêcher l\'ajout d\'annotations et de formulaires au fichier.','Disable Form Filling'=>'Désactiver le remplissage des formulaires','Disable Extraction'=>'Désactiver l\'extraction','Disable Assembly'=>'Désactiver l\'assemblage','Disable High Res Printing'=>'Désactiver l\'impression en haute résolution','PDF User Password'=>'Mot de passe de l’utilisateur PDF','This is a password your end user will need to enter before viewing the PDF file.'=>'Il s\'agit d\'un mot de passe que l\'utilisateur final devra saisir avant de pouvoir consulter le fichier PDF.','PDF Owner Password'=>'Mot de passe du propriétaire du PDF','An owner password allows the end user to take control of a PDF. Leave blank and it will be set by MD5 hash automatically (it will be different for every download, and you will not know it).'=>'Un mot de passe propriétaire permet à l\'utilisateur final de prendre le contrôle d\'un PDF. Si vous le laissez vide, il sera défini automatiquement par le hachage MD5 (il sera différent pour chaque téléchargement, et vous ne le saurez pas).','Unlock with User Password?'=>'Déverrouiller avec le mot de passe de l\'utilisateur ?','By default PDF protections can only be removed with an owner password. Check to allow removal with a user password. USE WITH CAUTION.'=>'Par défaut, les protections PDF ne peuvent être supprimées qu\'avec un mot de passe propriétaire. Cochez cette 