ur désactiver l\'assemblage (insertion, rotation ou suppression de pages et création de signets ou d\'images miniatures).','Check this box to make it more difficult for your PDF to be printed beautifully by the end consumer.'=>'Cochez cette case pour rendre plus difficile l\'impression de votre PDF par le consommateur final.','The only watermarking plugin for Easy Digital Downloads that works with <strong>any and every</strong> PDF is <a href="%s" target="_blank" rel="noopener">PDF Ink combined with the SetaPDF-Stamper add-on</a>.'=>'Le seul plugin de filigrane pour Easy Digital Downloads qui fonctionne avec <strong>tous les</strong> PDF est <a href="%s" target="_blank" rel="noopener">PDF Ink combiné avec le module complémentaire SetaPDF-Stamper</a>.','PDF Ink Lite Settings'=>'PDF Ink Lite Paramètres','Enable Watermarking'=>'Activez le tatouage','Check to watermark PDFs sold via Easy Digital Downloads using the settings below.'=>'Cochez la case pour filigraner les PDF vendus via Easy Digital Downloads en utilisant les paramètres ci-dessous.','List file name(s) of PDF(s), one per line, e.g.,'=>'Liste des noms de fichiers des PDF, un par ligne, par exemple,','or'=>'ou','If left blank and the Global checkbox above is checked, <strong>all</strong> PDFs sold through EDD will be watermarked.'=>'Si cette case n\'est pas cochée et que la case "Global" est cochée, <strong>tous les</strong> PDF vendus par l\'intermédiaire d\'EDD seront marqués d\'un filigrane.','Right to Left Watermarking'=>'De droite à gauche Watermarking','Check to switch from default left-to-right (LTR) to right-to-left (RTL), for Arabic, Hebrew, etc.'=>'Cochez pour passer du défaut de gauche à droite (LTR) à droite à gauche (RTL), pour l\'arabe, l\'hébreu, etc.','Pages to watermark'=>'Pages de filigrane','Watermark every page, the first page only, the last page only, every odd page, every even page, or custom page range. Defaults to `Every page`'=>'Filigrane toutes les pages, la première page uniquement, 