.','New with PDF Ink Lite v4: marked PDF files are stored in the wp-content/uploads/pdf-ink/ folder for easier management.'=>'Nouveau avec PDF Ink Lite v4 : les fichiers PDF marqués sont stockés dans le dossier wp-content/uploads/pdf-ink/ pour une gestion plus facile.','PDF Ink Lite Logs'=>'Journaux PDF Ink Lite','Check to watermark PDFs sold via WooCommerce using the settings below.'=>'Vérifiez que les PDF vendus via WooCommerce sont dotés d\'un filigrane en utilisant les paramètres ci-dessous.','File(s) to watermark'=>'Fichier (s) à filigrane',' Case-sensitive.'=>' Sensible à la casse.','Enable New Logic?'=>'Activer une nouvelle logique ?','If this box is checked, it changes how the `File(s) to Watermark` field above works. If checked, and "Enable Watermarking" is also checked, any files listed in the box will not be watermarked. If checked, and "Enable Watermarking" is not checked, any files listed in the box will be watermarked.'=>'Si cette case est cochée, elle modifie le fonctionnement du champ "Fichier(s) à filigraner" ci-dessus. Si cette case est cochée et que "Enable Watermarking" l\'est également, les fichiers listés dans la case ne seront pas filigranés. Si cette case est cochée et que "Activer le filigrane" ne l\'est pas, tous les fichiers listés dans la case seront filigranés.','Licensed to [FIRSTNAME] [LASTNAME], [EMAIL]'=>'Licence à [FIRSTNAME] [LASTNAME], [EMAIL]','The only watermarking plugin for WooCommerce that works with <strong>any and every</strong> PDF is <a href="%s" target="_blank" rel="noopener">PDF Ink combined with the SetaPDF-Stamper add-on</a>.'=>'Le seul plugin de filigrane pour WooCommerce qui fonctionne avec <strong>tous les</strong> PDF est <a href="%s" target="_blank" rel="noopener">PDF Ink combiné avec l\'extension SetaPDF-Stamper</a>.','Greyed-out settings below are included in the full (paid) plugin version. <a href="%s" target="_blank" rel="noopener">PDF Ink (the upgrade for this plugin)</a> will provide you with <a href="%s">m