ane est hautement personnalisable et manipulable.','<a href="%s" target="_blank" rel="noopener">Consider upgrading to PDF Ink</a> if you need more functionality.'=>'<a href="%s" target="_blank" rel="noopener">Envisagez de passer à PDF Ink</a> si vous avez besoin de plus de fonctionnalités.','For more information:'=>'Renseignements :','Frequently Asked Questions'=>'Foire aux questions','Plugin at WordPress.org'=>'Plugin sur WordPress.org','Upgrade'=>'Mettre à niveau','Cloning is forbidden.'=>'Le clonage est interdit.','Unserializing instances of this class is forbidden.'=>'La désérialisation des instances de cette classe est interdite.','<strong>PDF Ink Lite</strong> supports PHP %s or later. Please update PHP on your server for better overall results.'=>'<strong>PDF Ink Lite</strong> supporte PHP %s ou une version plus récente. Veuillez mettre à jour PHP sur votre serveur pour obtenir de meilleurs résultats.','<strong>PDF Ink Lite</strong> supports WordPress version %s or later. Please update WordPress to use this plugin.'=>'<strong>PDF Ink Lite</strong> est compatible avec la version de WordPress %s ou ultérieure. Veuillez mettre à jour WordPress pour utiliser ce plugin.','The <strong>PDF Ink Lite</strong> plugin requires WooCommerce be activated. You can <a href="%s" target="_blank" rel="noopener">download WooCommerce here</a>.'=>'Le plugin <strong>PDF Ink Lite</strong> nécessite l\'activation de WooCommerce. Vous pouvez <a href="%s" target="_blank" rel="noopener">télécharger WooCommerce ici</a>.','Sorry, <strong>PDF Ink Lite</strong> supports WooCommerce version %s or newer, for security reasons.'=>'Désolé, <strong>PDF Ink Lite</strong> supporte la version de WooCommerce %s ou plus récente, pour des raisons de sécurité.','PDF Ink Lite requires that the directory defined by <code>PDFINK_LITE_UPLOADS_PATH</code> (usually `<strong>wp-content/uploads/pdf-ink/</strong>`) is writable.'=>'PDF Ink Lite exige que le répertoire défini par <code>PDFINK_LITE_UPLOADS_PATH</co